MUTATIONS[702] = `mutation mutation702 { createUserMeta(data: {oldId:"13144",user:{connect:{oldId:"633"}},metaType:"",metaName:"userBio",metaValue:"%26quot%3BI%20guess%20you%20could%20say%20my%20path%20to%20becoming%20a%20musician%20wasn%26%23039%3Bt%20the%20most%20traditional%20or%20expected%2C%20but%20that%26%23039%3Bs%20what%20makes%20my%20story%20unique.%20I%20went%20to%20college%2C%20started%20a%20family%2C%20had%20a%20strong%2015%20year%20career%20in%20the%20insurance%20business%2C%20was%20a%20police%20officer%20for%208%20years%20and%20have%20finally%20found%20myself%20in%20the%20music%20industry.%26quot%3B%0D%0A%20%0D%0ASince%20the%20age%20of%205%2C%20Allan%20has%20been%20singing.%20Allan%20grew%20up%20listening%20to%20all%20forms%20of%20music%2C%20from%20Garth%20Brooks%20to%20AC/DC%2C%20from%20Tim%20McGraw%20to%20Van%20Halen%2C%20and%20everything%20in%20between.%20Even%20during%20the%20early%20formative%20years%20of%20his%20learning%20about%20music%2C%20Allan%20was%20not%20afraid%20to%20step%20up%20as%20a%20performer.%20%26quot%3BOne%20fall%20day%2C%20when%20I%20was%20in%20the%20second%20grade%2C%20for%20show-and-tell%2C%20I%20wrote%20the%20lyrics%20down%20to%20%26quot%3BHappy%20Birthday%2C%20Baby%2C%26quot%3B%20by%20Ronnie%20Milsap.%20I%20showed%20the%20class%20I%20could%20write%20these%20lyrics%20down%2C%20and%20then%20I%20sang%20the%20song%20a%20cappella.%20It%20wasn%26%23039%3Bt%20a%20big%20deal%20to%20me%2C%20but%20to%20others%20it%20seemed%20like%20such%20a%20big%20deal.%20Even%20to%20this%20day%2C%20I%20remember%20that%20day.%20I%20remember%20the%20response%20of%20my%20friends%20and%20teacher.%20It%u2019s%20just%20something%20I%20do.%20Even%20to%20this%20day%2C%20it%u2019s%20just%20something%20I%20do.%26quot%3B%0D%0A%0D%0AAllan%20has%20toured%20the%20United%20States%20for%20many%20years%20performing%20shows%2C%20major%20events%20and%20has%20opened%20for%20numerous%20national%20touring%20artists.%20Those%20experiences%20have%20been%20lived%20to%20the%20fullest%2C%20and%20now%20he%20is%20looking%20forward%20to%20what%u2019s%20to%20come.%20%26quot%3BI%26%23039%3Bm%20not%20much%20on%20talking%20about%20the%20past.%20I%20would%20rather%20talk%20about%20the%20future.%20I%20have%20learned%20so%20much%20from%20the%20past%2C%20and%20I%26%23039%3Bve%20learned%20many%20lessons.%20I%20have%20so%20much%20respect%20for%20the%20people%20in%20my%20life%20and%20the%20musicians%20I%20have%20performed%20with%2C%20but%20the%20future%20is%20where%20we%20are%20headed.%26quot%3B%0D%0A%0D%0AOver%20the%20years%2C%20Allan%20has%20performed%20with%20Eric%20Church%2C%20Luke%20Bryan%2C%20The%20Band%20Perry%2C%20Justin%20Moore%2C%20Randy%20Houser%2C%20living-legend%20Randy%20Travis%2C%20and%20one%20of%20the%20true%20icons%20of%20country%20music%2C%20George%20Jones.%20%26quot%3BWorking%20with%20George%20Jones%20on%20his%20final%20tour%2C%20before%20he%20passed%2C%20is%20a%20moment%20in%20my%20life%20I%20will%20never%20forget.%20We%20all%20have%20%26quot%3Bchoices%26quot%3B%20in%20this%20world.%20Watching%20him%20sing%20that%20song%20live%2C%20watching%20him%20perform%20that%20song%20just%20days%20before%20he%20passed%2C%20is%20something%20I%20will%20never%20forget.%20Songs%20have%20such%20deep%20meanings%2C%20and%20lyrics%20that%20touch%20people%u2019s%20hearts.%20I%20have%20been%20touched%20by%20the%20music%20of%20past%20legends%20and%20current%20artists%2C%20and%20I%20look%20forward%20to%20reaching%20out%20to%20people%20with%20my%20own%20music%20and%20my%20own%20voice%u2026to%20touch%20their%20lives.%26quot%3B%20Allan%20has%20also%20been%20on%20tour%20with%20The%20Lost%20Trailers%2C%20Gretchen%20Wilson%2C%20Florida%20Georgia%20Line%2C%20Lee%20Brice%2C%20Dustin%20Lynch%2C%20Joe%20Nichols%2C%20Joe%20Diffie%2C%20Kellie%20Pickler%2C%20Phil%20Vassar%2C%20Bucky%20Covington%2C%20Confederate%20Railroad%2C%20Swon%20Bros%2C%20Danielle%20Bradberry%2C%20Jared%20Blake%2C%20Buddy%20Jewel%2C%20Josh%20Kelly%2C%20Easton%20Corbin%2C%20Matt%20Stillwell%2C%20Bomshel%2C%20Cristian%20Kain%2C%20Crossin%20Dixon%2C%20Gloriana%2C%20Pat%20Green%2C%20Jamey%20Johnson%2C%20Jeff%20Bates%2C%20John%20Conlee%2C%20Josh%20Gracin%2C%20Julianne%20Hough%2C%20Neal%20Mccoy%2C%20Sarah%20Buxton%2C%20Steel%20Magnolia%2C%20The%20Wreckers%2C%20The%20Trailor%20Choir%2C%20Bret%20Eldridge%2C%20Chris%20Young%2C%20Leann%20Rimes%2C%20James%20Otto%2C%20Trent%20Tomlinson%2C%20Chuck%20Wicks%2C%20Jason%20Michael%20Carrol%2C%20Trent%20Willmon%2C%20Trick%20Pony%2C%20Ty%20Herndon%2C%20Keith%20Anderson%2C%20Chris%20Cagle%2C%20Billy%20Currington%2C%20Aaron%20Tippin%2C%20Edens%20Edge%2C%20Heidi%20Newfield%20and%20Craig%20Morgan.%0D%0A%0D%0AAllan%26%23039%3Bs%20Music%20has%20been%20heard%20around%20the%20world%21%20In%20the%20last%20two%20years%20Allan%20has%20had%203%20top%20ten%20hits%20in%20Europe%20with%20the%20songs%20%26quot%3BCornfields%26quot%3B%2C%20%26quot%3BLet%26%23039%3Bs%20Get%20Gone%26quot%3B%20and%20%26quot%3BSorry%26quot%3B.%20Allan%20has%20had%20the%20pleasure%20of%20working%20with%20Lee%20Williams%2C%20a%20well-known%20country%20music%20broadcaster%20in%20Europe.%20%26quot%3BLee%20is%20a%20great%20man%20and%20he%20has%20helped%20so%20much%20in%20getting%20my%20music%20all%20over%20the%20world%21%21%20I%20consider%20him%20a%20friend.%26quot%3B%0D%0A%0D%0A%26quot%3BIn%202014%2C%20Erik%20Halbig%20agreed%20to%20work%20with%20me%2C%20so%20I%20was%20very%20excited%2C%26quot%3B%20Allan%20said.%20Erik%20Halbig%20signed%20on%20to%20be%20Allan%26%23039%3Bs%20executive%20producer%20and%20music%20consultant.%20Erik%20has%2019%20years%20of%20experience%20in%20Nashville%20and%20has%20traveled%20the%20globe%2C%20performing%20for%20many%20major%20touring%20artists.%20As%20Allan%20describes%20him%2C%20%u201CErik%20is%20special.%20He%20has%20a%20talent%20for%20hearing%20music%2C%20writing%20music%2C%20and%20leading.%20Erik%20is%20one%20of%20the%20smartest%20people%20you%20will%20ever%20meet.%20He%20also%20has%20a%20love%20for%20music%2C%20and%20he%20lives%20it%20out%20every%20day%20of%20his%20life.%20He%20is%20a%20down%20to%20earth%20person%20and%20someone%20that%20fits%20as%20the%20leader%20of%20my%20team.%26quot%3B%0D%0A%0D%0AIndiana%20is%20Allan%26%23039%3Bs%20home%2C%20but%20the%20world%20is%20his%20office.%20Allan%20continues%20to%20tour%20the%20nation%2C%20doing%20what%20he%20loves%3A%20making%20music.%20You%20will%20never%20meet%20a%20person%20that%20is%20more%20competitive%2C%20but%20with%20a%20genuine%20heart%20for%20people.%20You%20will%20believe%20in%20the%20music%20and%20lyrics%20that%20he%20sings%2C%20and%20you%20will%20become%20a%20friend%20long%20before%20you%20become%20a%20fan.%20Allan%20has%20a%20way%20of%20triggering%20emotion%2C%20and%20has%20a%20passion%20for%20creating%20experiences.%20We%20think%20you%20will%20feel%20both%21",metaDeleted:false}) { id } } `
    
